import React from "react";

const Footer = () => (
  <footer className="bg-gray-800 text-white py-6 mt-12">
    <div className="container mx-auto text-center">
      <p>© 2025 كل الحقوق محفوظة منصة اعلامي بالذكاء الاصطناعي</p>
    </div>
  </footer>
);

export default Footer;
